import { GET_PRODUCTS, SET_CATEGORY, SET_PRICE, SET_QUERY  } from "../actions";

const DEFAULT_STATE = {}

const reducer = function (state = DEFAULT_STATE, action) {
    switch(action.type){
        case GET_PRODUCTS:
            return action.payload.data;
        case SET_CATEGORY:
            return action.payload;
        case SET_PRICE:
            console.log('reducers', action.payload)
            return action.payload;
        case SET_QUERY:
            return action.payload
        default:
                return state;
    }
}

export default reducer;
